[[package]]
name = "async-timeout"
version = "4.0.2"
requires_python = ">=3.6"
summary = "Timeout context manager for asyncio programs"

[[package]]
name = "pyaes"
version = "1.6.1"
summary = "Pure-Python Implementation of the AES block-cipher and common modes of operation"

[[package]]
name = "pyasn1"
version = "0.4.8"
summary = "ASN.1 types and codecs"

[[package]]
name = "python-socks"
version = "2.0.2"
summary = "Core proxy (SOCKS4, SOCKS5, HTTP tunneling) functionality for Python"

[[package]]
name = "python-socks"
version = "2.0.2"
extras = ["asyncio"]
summary = "Core proxy (SOCKS4, SOCKS5, HTTP tunneling) functionality for Python"
dependencies = [
    "async-timeout>=3.0.1",
    "python-socks",
]

[[package]]
name = "rsa"
version = "4.8"
requires_python = ">=3.6,<4"
summary = "Pure-Python RSA implementation"
dependencies = [
    "pyasn1>=0.1.3",
]

[[package]]
name = "telethon"
version = "1.24.0"
requires_python = ">=3.5"
summary = "Full-featured Telegram client library for Python 3"
dependencies = [
    "pyaes",
    "rsa",
]

